import React, { Component } from "react";
import { connect } from "react-redux";
import Navbar from "react-bootstrap/Navbar";
import {
  Button,
  Container,
  Tabs,
  Tab,
  Form,
  Row,
  Col,
  FormGroup
} from "react-bootstrap";
import "../../css/grubhub.css";

class UserSignUp extends Component {
  constructor(props) {
    super(props);
    this.state = {
      activeTab: props.activeTab || 1
    };
  }

  render() {
    return (
      <div>
        <Navbar bg="dark" variant="dark">
          <Navbar.Brand href="/">GrubHub</Navbar.Brand>
        </Navbar>
        <Container>
          <div className="login u-dimension-1">
            <h3>Creae your GrubHub Account</h3>
            <Form className="pt-3">
              <Row>
                <Col>
                  <FormGroup>
                    <Form.Label>First Name</Form.Label>
                    <Form.Control name="firstName"></Form.Control>
                  </FormGroup>
                </Col>
                <Col>
                  <FormGroup>
                    <Form.Label>Last Name</Form.Label>
                    <Form.Control name="lastName"></Form.Control>
                  </FormGroup>
                </Col>
              </Row>
              <Form.Group>
                <Form.Label>Email</Form.Label>
                <Form.Control name="Email"></Form.Control>
              </Form.Group>
              <Form.Group>
                <Form.Label>Password</Form.Label>
                <Form.Control name="Password" type="password"></Form.Control>
              </Form.Group>
              <Form.Group>
                <Button variant="primary" type="submit" className="btn-block">
                  Create Account
                </Button>
              </Form.Group>
            </Form>
          </div>
        </Container>
      </div>
    );
  }
}
function mapStoreToProps(state) {
  return state;
}
export default connect(mapStoreToProps)(UserSignUp);
